Wes Anderson is a creative genius and l WILL die on this hill. Just so you know where I’m coming from.

I’ve got the version of the script offered up to the Academy so this should be a nice change from the last few flicks; so far it’s as you would likely imagine it to be: thick as fuck. I’m entirely here for it.

Again, having the director as the writer means many action lines/descriptions are quite lengthy that would probably be cut down or cut out were this a spec script...that being said, there are certain shots that are blooming with color & small detail yet he’s provided himself with no description of what that scene was to look like at all. Wild. I suppose someone like him simply knows how it’s going to look.

It’s almost like a stop motion picture mixed with a classic silent film. God it’s beautiful and just so ridiculously creative. How does someone come up with the likes of this? And so perfectly cast, of course. 

Willem Dafoe is a king.

“I thought l was supposed to be a fucking faggot.”
“You are, but you’re bisexual!” Literally the greatest lines I’ve heard, possibly ever.

2014 was a BRILLIANT year for screenwriting: Birdman, Nightcrawler, Foxcatcher & Boyhood. 

The end of this film is fucking gutting and absolutely perfect. Ugh. What else is there to say?

What did you think of this film? Good? Bad?? Fancy a nice European pastry?!

Share your thoughts!

